sys_remote_update_set.description:
El BUS detecta notificación(correo) de SuccessFactors en Office365, realizando un mapeo de categorías con base en la estructura del correo que se desencadena.
Datos que se envían:
Candidato {FirstName} {LastName} {customMaternal}
Requisicion {title}
ID requisicion {JobReqId}
Generalista {ManagerFullName}
Reclutador {RecruiterFullName}
{ReqZona}
%customer=L{HRManager}
%requester=L{HRManager}
